/*
  -----------------------------------------------------------------------------
  DESCRIPTION: mod() calculates the modulo accounting for negative values and always outputting a positive value.

  OPERATION:   To perform (a % b), we calculate a % b using the modulo operator, add b to get rid of negative values, and then % b again

  ARGUMENTS: int32_t xMod, int32_t mMod: the two inputs; we are evaluating xMod % mMod

  RETURNS: int32_t, a positive number

  INPUTS: None

  OUTPUTS: None

  LOCAL VARIABLES: None

  SHARED VARIABLES: None

  GLOBAL VARIABLES: None

  DEPENDENCIES: None
  -----------------------------------------------------------------------------
*/ 
int32_t mod(int32_t xMod, int32_t mMod) {
  return (xMod % mMod + mMod) % mMod;
}

